import PropTypes from 'prop-types';
import React from 'react';
import 'antd/dist/antd.css';

const App = ({ Component }) => {
  return (
    <>
      <div>공통메뉴</div>
      <Component />
    </>
  );
};

App.PropTypes = {
  Component: PropTypes.elementType.isRequired,
};

export default App;
